import 'semantic-ui-css/semantic.min.css';
import FormExampleCaptureValues from './FormExampleCV';
import ButtonExample from './ButtonExample';
import FormExampleSubmitText from './FormExpampleSubmitText';

function App() {
  return (
  <div >
    <h2>Hello</h2> 
    <FormExampleCaptureValues />
    <ButtonExample />
    <br></br>
    <FormExampleSubmitText />
  </div>
  );
}

export default App;
